query SiteShowcaseQuery {
  allStartersYaml(filter: {fields: {hasScreenshot: {eq: true}}}) {
    edges {
      node {
        id
        fields {
          starterShowcase {
            slug
            stub
            description
            stars
            lastUpdated
            owner
            name
            githubFullName
            gatsbyMajorVersion
            allDependencies
            gatsbyDependencies
            miscDependencies
          }
        }
        url
        repo
        description
        tags
        features
        internal {
          type
        }
        childScreenshot {
          screenshotFile {
            childImageSharp {
              fluid(maxWidth: 512) {
                ...GatsbyImageSharpFluid_noBase64
              }
            }
          }
        }
      }
    }
  }
}

fragment GatsbyImageSharpFluid_noBase64 on ImageSharpFluid {
  aspectRatio
  src
  srcSet
  sizes
}
